import React from "react";
import { List } from "antd";

const FollowerList = ({ header, data }) => {
  return (
    <List
      style={{ marginBottom: 20 }}
      grid={{ gutter: 4, xs: 2, md: 3 }}
      header={<div>{header}</div>}
    />
  );
};

export default FollowerList;
